pub enum Request {

    #[doc =
      "This is a destructor, once sent this object cannot be used any longer."]
    Destroy,

    #[doc =
      "commit string\n\nSend the commit string text for insertion to the application.\n\nThe text to commit could be either just a single character after a key\npress or the result of some composing (pre-edit). It could be also an\nempty text when some text should be removed (see\ndelete_surrounding_text) or when the input cursor should be moved (see\ncursor_position).\n\nAny previously set composing text will be removed."]
    CommitString {
        serial: u32,
        text: String,
    },

    #[doc =
      "pre-edit string\n\nSend the pre-edit string text to the application text input.\n\nThe commit text can be used to replace the pre-edit text on reset (for\nexample on unfocus).\n\nPreviously sent preedit_style and preedit_cursor requests are also\nprocessed by the text_input."]
    PreeditString {
        serial: u32,
        text: String,
        commit: String,
    },

    #[doc =
      "pre-edit styling\n\nSet the styling information on composing text. The style is applied for\nlength in bytes from index relative to the beginning of\nthe composing text (as byte offset). Multiple styles can\nbe applied to a composing text.\n\nThis request should be sent before sending a preedit_string request."]
    PreeditStyling {
        index: u32,
        length: u32,
        style: u32,
    },

    #[doc =
      "pre-edit cursor\n\nSet the cursor position inside the composing text (as byte offset)\nrelative to the start of the composing text.\n\nWhen index is negative no cursor should be displayed.\n\nThis request should be sent before sending a preedit_string request."]
    PreeditCursor {
        index: i32,
    },

    #[doc =
      "delete text\n\nRemove the surrounding text.\n\nThis request will be handled on the text_input side directly following\na commit_string request."]
    DeleteSurroundingText {
        index: i32,
        length: u32,
    },

    #[doc =
      "set cursor to a new position\n\nSet the cursor and anchor to a new position. Index is the new cursor\nposition in bytes (when >= 0 this is relative to the end of the inserted text,\notherwise it is relative to the beginning of the inserted text). Anchor is\nthe new anchor position in bytes (when >= 0 this is relative to the end of the\ninserted text, otherwise it is relative to the beginning of the inserted\ntext). When there should be no selected text, anchor should be the same\nas index.\n\nThis request will be handled on the text_input side directly following\na commit_string request."]
    CursorPosition {
        index: i32,
        anchor: i32,
    },

    #[doc = ""]
    ModifiersMap {
        map: Vec<u8>,
    },

    #[doc =
      "keysym\n\nNotify when a key event was sent. Key events should not be used for\nnormal text input operations, which should be done with commit_string,\ndelete_surrounding_text, etc. The key event follows the wl_keyboard key\nevent convention. Sym is an XKB keysym, state is a wl_keyboard key_state."]
    Keysym {
        serial: u32,
        time: u32,
        sym: u32,
        state: u32,
        modifiers: u32,
    },

    #[doc =
      "grab hardware keyboard\n\nAllow an input method to receive hardware keyboard input and process\nkey events to generate text events (with pre-edit) over the wire. This\nallows input methods which compose multiple key events for inputting\ntext like it is done for CJK languages."]
    GrabKeyboard {
    },

    #[doc =
      "forward key event\n\nForward a wl_keyboard::key event to the client that was not processed\nby the input method itself. Should be used when filtering key events\nwith grab_keyboard.  The arguments should be the ones from the\nwl_keyboard::key event.\n\nFor generating custom key events use the keysym request instead."]
    Key {
        serial: u32,
        time: u32,
        key: u32,
        state: u32,
    },

    #[doc =
      "forward modifiers event\n\nForward a wl_keyboard::modifiers event to the client that was not\nprocessed by the input method itself.  Should be used when filtering\nkey events with grab_keyboard. The arguments should be the ones\nfrom the wl_keyboard::modifiers event."]
    Modifiers {
        serial: u32,
        mods_depressed: u32,
        mods_latched: u32,
        mods_locked: u32,
        group: u32,
    },

    #[doc = ""]
    Language {
        serial: u32,
        language: String,
    },

    #[doc = ""]
    TextDirection {
        serial: u32,
        direction: u32,
    },
}

