pub enum Event {

    #[doc =
      "multi-finger swipe begin\n\nThis event is sent when a multi-finger swipe gesture is detected\non the device."]
    Begin {
        serial: u32,
        time: u32,
        surface: super::wl_surface::WlSurface,
        fingers: u32,
    },

    #[doc =
      "multi-finger swipe motion\n\nThis event is sent when a multi-finger swipe gesture changes the\nposition of the logical center.\n\nThe dx and dy coordinates are relative coordinates of the logical\ncenter of the gesture compared to the previous event."]
    Update {
        time: u32,
        dx: f64,
        dy: f64,
    },

    #[doc =
      "multi-finger swipe end\n\nThis event is sent when a multi-finger swipe gesture ceases to\nbe valid. This may happen when one or more fingers are lifted or\nthe gesture is cancelled.\n\nWhen a gesture is cancelled, the client should undo state changes\ncaused by this gesture. What causes a gesture to be cancelled is\nimplementation-dependent."]
    End {
        serial: u32,
        time: u32,
        cancelled: i32,
    },
}

