pub enum Event {

    #[doc =
      "multi-finger pinch begin\n\nThis event is sent when a multi-finger pinch gesture is detected\non the device."]
    Begin {
        serial: u32,
        time: u32,
        surface: super::wl_surface::WlSurface,
        fingers: u32,
    },

    #[doc =
      "multi-finger pinch motion\n\nThis event is sent when a multi-finger pinch gesture changes the\nposition of the logical center, the rotation or the relative scale.\n\nThe dx and dy coordinates are relative coordinates in the\nsurface coordinate space of the logical center of the gesture.\n\nThe scale factor is an absolute scale compared to the\npointer_gesture_pinch.begin event, e.g. a scale of 2 means the fingers\nare now twice as far apart as on pointer_gesture_pinch.begin.\n\nThe rotation is the relative angle in degrees clockwise compared to the previous\npointer_gesture_pinch.begin or pointer_gesture_pinch.update event."]
    Update {
        time: u32,
        dx: f64,
        dy: f64,
        scale: f64,
        rotation: f64,
    },

    #[doc =
      "multi-finger pinch end\n\nThis event is sent when a multi-finger pinch gesture ceases to\nbe valid. This may happen when one or more fingers are lifted or\nthe gesture is cancelled.\n\nWhen a gesture is cancelled, the client should undo state changes\ncaused by this gesture. What causes a gesture to be cancelled is\nimplementation-dependent."]
    End {
        serial: u32,
        time: u32,
        cancelled: i32,
    },
}

