pub enum Event {

    #[doc =
      "group announced\n\nSent on wp_tablet_pad initialization to announce available groups.\nOne event is sent for each pad group available.\n\nThis event is sent in the initial burst of events before the\nwp_tablet_pad.done event. At least one group will be announced."]
    Group {
        pad_group: Main<super::zwp_tablet_pad_group_v2::ZwpTabletPadGroupV2>,
    },

    #[doc =
      "path to the device\n\nA system-specific device path that indicates which device is behind\nthis wp_tablet_pad. This information may be used to gather additional\ninformation about the device, e.g. through libwacom.\n\nThe format of the path is unspecified, it may be a device node, a\nsysfs path, or some other identifier. It is up to the client to\nidentify the string provided.\n\nThis event is sent in the initial burst of events before the\nwp_tablet_pad.done event."]
    Path {
        path: String,
    },

    #[doc =
      "buttons announced\n\nSent on wp_tablet_pad initialization to announce the available\nbuttons.\n\nThis event is sent in the initial burst of events before the\nwp_tablet_pad.done event. This event is only sent when at least one\nbutton is available."]
    Buttons {
        buttons: u32,
    },

    #[doc =
      "pad description event sequence complete\n\nThis event signals the end of the initial burst of descriptive\nevents. A client may consider the static description of the pad to\nbe complete and finalize initialization of the pad."]
    Done,

    #[doc =
      "physical button state\n\nSent whenever the physical state of a button changes."]
    Button {
        time: u32,
        button: u32,
        state: ButtonState,
    },

    #[doc =
      "enter event\n\nNotification that this pad is focused on the specified surface."]
    Enter {
        serial: u32,
        tablet: super::zwp_tablet_v2::ZwpTabletV2,
        surface: super::wl_surface::WlSurface,
    },

    #[doc =
      "enter event\n\nNotification that this pad is no longer focused on the specified\nsurface."]
    Leave {
        serial: u32,
        surface: super::wl_surface::WlSurface,
    },

    #[doc =
      "pad removed event\n\nSent when the pad has been removed from the system. When a tablet\nis removed its pad(s) will be removed too.\n\nWhen this event is received, the client must destroy all rings, strips\nand groups that were offered by this pad, and issue wp_tablet_pad.destroy\nthe pad itself."]
    Removed,
}

pub enum Request {

