      "request activation\n\nRequests the text_input object to be activated (typically when the\ntext entry gets focus).\n\nThe seat argument is a wl_seat which maintains the focus for this\nactivation. The surface argument is a wl_surface assigned to the\ntext_input object and tracked for focus lost. The enter event\nis emitted on successful activation."]
    Activate {
        seat: super::wl_seat::WlSeat,
        surface: super::wl_surface::WlSurface,
    },

    #[doc =
      "request deactivation\n\nRequests the text_input object to be deactivated (typically when the\ntext entry lost focus). The seat argument is a wl_seat which was used\nfor activation."]
    Deactivate {
        seat: super::wl_seat::WlSeat,
    },

    #[doc =
      "show input panels\n\nRequests input panels (virtual keyboard) to show."]
    ShowInputPanel,

    #[doc =
      "hide input panels\n\nRequests input panels (virtual keyboard) to hide."]
    HideInputPanel,

    #[doc =
      "reset\n\nShould be called by an editor widget when the input state should be\nreset, for example after the text was changed outside of the normal\ninput method flow."]
    Reset,

    #[doc =
      "sets the surrounding text\n\nSets the plain surrounding text around the input position. Text is\nUTF-8 encoded. Cursor is the byte offset within the\nsurrounding text. Anchor is the byte offset of the\nselection anchor within the surrounding text. If there is no selected\ntext anchor, then it is the same as cursor."]
    SetSurroundingText {
        text: String,
        cursor: u32,
        anchor: u32,
    },

    #[doc =
      "set content purpose and hint\n\nSets the content purpose and content hint. While the purpose is the\nbasic purpose of an input field, the hint flags allow to modify some\nof the behavior.\n\nWhen no content type is explicitly set, a normal content purpose with\ndefault hints (auto completion, auto correction, auto capitalization)\nshould be assumed."]
    SetContentType {
        hint: u32,
        purpose: u32,
    },

    #[doc = ""]
    SetCursorRectangle {
        x: i32,
        y: i32,
        width: i32,
        height: i32,
    },

    #[doc =
      "sets preferred language\n\nSets a specific language. This allows for example a virtual keyboard to\nshow a language specific layout. The \"language\" argument is an RFC-3066\nformat language tag.\n\nIt could be used for example in a word processor to indicate the\nlanguage of the currently edited document or in an instant message\napplication which tracks languages of contacts."]
    SetPreferredLanguage {
        language: String,
    },

    #[doc = ""]
    CommitState {
        serial: u32,
    },

    #[doc = ""]
    InvokeAction {
        button: u32,
        index: u32,
    },
}

pub enum Event {

    #[doc =
      "enter event\n\nNotify the text_input object when it received focus. Typically in\nresponse to an activate request."]
    Enter {
        surface: super::wl_surface::WlSurface,
    },

    #[doc =
      "leave event\n\nNotify the text_input object when it lost focus. Either in response\nto a deactivate request or when the assigned surface lost focus or was\ndestroyed."]
    Leave,

    #[doc =
      "modifiers map\n\nTransfer an array of 0-terminated modifier names. The position in\nthe array is the index of the modifier as used in the modifiers\nbitmask in the keysym event."]
    ModifiersMap {
        map: Vec<u8>,
    },

    #[doc =
      "state of the input panel\n\nNotify when the visibility state of the input panel changed."]
    InputPanelState {
        state: u32,
    },

    #[doc =
      "pre-edit\n\nNotify when a new composing text (pre-edit) should be set around the\ncurrent cursor position. Any previously set composing text should\nbe removed.\n\nThe commit text can be used to replace the preedit text on reset\n(for example on unfocus).\n\nThe text input should also handle all preedit_style and preedit_cursor\nevents occurring directly before preedit_string."]
    PreeditString {
        serial: u32,
        text: String,
        commit: String,
    },

    #[doc =
      "pre-edit styling\n\nSets styling information on composing text. The style is applied for\nlength bytes from index relative to the beginning of the composing\ntext (as byte offset). Multiple styles can\nbe applied to a composing text by sending multiple preedit_styling\nevents.\n\nThis event is handled as part of a following preedit_string event."]
    PreeditStyling {
        index: u32,
        length: u32,
        style: u32,
